### Individual Models

Here we look at **linear regressions** of year by kettle timing dates.




::: {.cell}

```{.r .cell-code  code-fold="false"}
m1 <- lm(mig_start_doy ~ year, data = v)
m2 <- lm(peak_start_doy ~ year, data = v)
